import React, { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [timer, setTimer] = useState(0)

  useEffect(()=>{
    const timerinterval= setInterval(()=>{
      setTimer((previous)=>previous+1)
    },1000)

    return ()=>{
      clearInterval(timerinterval)
    }
  },[])



  return (
    <div className="App">
      <h1>{timer}</h1>
      <button>Stop</button>
      <button>Reset</button>
    </div>
  );
}

export default App;
